import React from "react";
import "./SchoolList.css";
import EngineeringIcon from "@mui/icons-material/Engineering";
const SchoolList = () => {
  return (
    <div className="school">
      <div className="sfeaturedItem">
        <div className="card">
          {/* <img
            src="https://imgk.timesnownews.com/story/IIT_Delhi_6.jpg"
            className="schoolImg"
            alt="College"
          /> */}
          <div className="domain_image">
            <EngineeringIcon className="schoolImg" size="large"/>
          </div>
        </div>
      </div>
      {/* item2 */}
      <div className="sfeaturedItem">
        <div className="card">
          {/* <img
            src="https://imgk.timesnownews.com/story/IIT_Delhi_6.jpg"
            className="schoolImg"
            alt="College"
          /> */}
        </div>
      </div>
      {/* item3 */}
      <div className="sfeaturedItem">
        <div className="card">
          {/* <img
            src="https://imgk.timesnownews.com/story/IIT_Delhi_6.jpg"
            className="schoolImg"
            alt="College"
          /> */}
        </div>
      </div>
    </div>
  );
};

export default SchoolList;
